(16, '795653', 'Global X Lithium', 'Active', '10000', NULL, '21', '20', '1', 'LIT tracks a market-cap-weighted index of 20-40 companies involved in the global mining and exploration of lithium, or in lithium battery production. While the plain-vanilla fund gives broad exposure to the lithium industry, it manages to offer targeted, concentrated exposure with a micro-cap tilt. LIT is an excellent fit for investors looking for niche lithium exposure as an ETF. The index is reconstituted and rebalanced on an annual basis.', 'Disabled', NULL, NULL, '1', '0', 'upload/plans/plan_image_664f6f1ea24cf.svg', 0, '2024-05-23 11:00:22', '2024-05-23 11:00:22', 0),
(17, '848382', 'Lithium Americas Corp.', 'Active', '10000', NULL, '11', '20', '0.99', 'Lithium Americas Corp. owns and operates the Thacker Pass project. It is focused on advancing Thacker Pass to production it is located in northern Nevada. The company is headquartered in Vancouver, Canada.', 'Disabled', NULL, NULL, '1', '0', 'upload/plans/plan_image_664f6f870e4ed.svg', 0, '2024-05-23 11:02:07', '2024-05-23 11:02:07', 0),
(18, '229490', 'D2 LITHIUM', 'Active', '5000', NULL, '11', '20', '1', 'D2 Lithium Corp. is a junior mining company, which engages in the business of identifying, evaluating, acquiring, and exploring mineral properties. Its properties include Teels Marsh, Alkali Lake, Guayatoyoc, and Fox Creek projects. The company was founded on January 13, 2022, and is headquartered in Langley, Canada.', 'Disabled', NULL, NULL, '1', '12000', 'upload/plans/plan_image_664f6fc85cd56.svg', 1, '2024-05-23 11:03:12', '2024-05-23 15:28:25', 0),
(19, '135174', 'LITHIUM IONIC CORP', 'Active', '10000', 'Daily', '1', '20', '1', 'Lithium Ionic Corp. is a canadian junior exploration company focused on developing commercial-grade lithium economically and safely. It engages in Itinga lithium project in Brazil, including access to hydroelectrical grid power, water, a commercial port, highways and communities. The company is headquartered in Toronto, Canada.', 'Disabled', 1, 'Disabled', '1', '0', 'upload/plans/plan_image_664f70204af65.svg', 0, '2024-05-23 11:04:14', '2024-05-23 11:04:40', 0),
(20, '390108', 'INTERNATIONAL LITHIUM', 'Active', '20000', NULL, '1', '1', '1', 'International Lithium Corp. engages in the exploration of mineral properties. It\'s projects include Raleigh Lake, Mariana, Mavis Lake, Avalonia, and Forgan Lake and West Georgia. The company was founded on March 26, 2009 and is headquartered in Vancouver, Canada.', 'Disabled', 1, 'Enabled', '1', '143046', 'upload/plans/plan_image_664f707304f2d.svg', 6, '2024-05-23 11:06:03', '2024-06-09 06:38:44', 0);
